import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <div className="footer-wrapper">
      <div className="footer-content">
        <div>InMate Skills</div>
        <div>&copy;</div>
      </div>
    </div>
  );
};

export default Footer;
